import React from 'react'
import Chart from 'chart.js'

const LineChart = () => {
  const ctx = 'myChart'

  const myChart = new Chart(ctx, {
    tipe: 'line'
  })

  return (
    <canvar id="myChart" width="400" height="400" />
  )
}

export default LineChart
